import React, { useEffect } from 'react';
import axios from 'axios';

function ManagerMain() {
    useEffect(()=>{
        const url = 'https://accounts.google.com/o/oauth2/v2/auth?client_id=780867118511-7phr24j325eauivpisavdb062rmi68er.apps.googleusercontent.com&response_type=token&redirect_uri=https://localhost:3000&scope=https://www.googleapis.com/auth/userinfo.email'
        axios.get(url)
        .then((response) => {
            console.log('response : ', response);
            return;
        })
        .catch((error) => {
            console.log('error : ', error);
            return;
        })
    },[])
    return (
        <div>
            관리자메인페이지
            여기다가 처음 페이지를 Oath 로그인을 하도록 하자. 그리고 토큰을 주고 그 토큰으로 
            관리자 페이지에서 Authorization을 할 수 있도록 하자.

        </div>
    )
}

export default ManagerMain
